function test_targets = multiclass_sbc(train_patterns, train_targets, test_patterns, params)

% Multiclass classification using a single two-class classifier (See
% El-Yaniv, Kotek, Pechyony, and Yom-Tov, 2006)
%
% 	train_patterns	- Train patterns
%	train_targets	- Train targets
%   test_patterns   - Test  patterns
%	params  		- [Type of embedding, resample?, classification algorithm, algorithm parameters]
%                     The type of matrix can be:
%                       Ident   - An identity matrix
%                       BCH     - BCH Coding matrix (Recommended)
%                     If the resample flag is set, the training data is
%                     sampled. This is recommended, as the performance is
%                     usually not degraded.
%
%Outputs
%	test_targets	- Predicted targets
%
% IMPORTANT NOTE: The classifiers in the Classification Toolbox are not
% soft-valued, while this function requires that they will be soft-valued.
% Therefore, before executing this function modify your classifier by
% removing the (usually) last line of the code where the labels are collapsed into
% two values. This line is in the form of: test_targets = test_targets > 0;
%
%See also multiclass
%
%Example:
% load multiclass_xor
% t = multiclass_sbc(patterns, targets, patterns, '[''Ident'', 0, ''LS'', []]');
% disp(mean(t == targets))

[type, resample, class_alg, class_alg_params]   = process_params(params);
[D, N]                                          = size(train_patterns);
[Uc, temp, temp_train_targets]                  = unique(train_targets);
Nc                                              = length(Uc);
Ntest                                           = size(test_patterns, 2);

switch lower(type)
    case {'ident', 'identity'}
        %Build new train data
        target_mat_vec                  = repmat([1:Nc], N, 1);
        target_mat                      = -ones(Nc, N*Nc);
        target_mat(sub2ind(size(target_mat), target_mat_vec(:)', 1:N*Nc)) = 1;
        new_train_patterns              = [repmat(train_patterns, 1, Nc); target_mat];

        %Build new test data
        target_mat_vec                  = repmat([1:Nc], Ntest, 1);
        target_mat                      = -ones(Nc, Ntest*Nc);
        target_mat(sub2ind(size(target_mat), target_mat_vec(:)', 1:Ntest*Nc)) = 1;
        new_test_patterns               = [repmat(test_patterns, 1, Nc); target_mat];
        in_new = D+[1:Nc];
    case 'bch'
        coding_matrix                   = get_BCH_code(Nc);
        
        %Build new train data
        target_mat                      = repmat(1:length(Uc), N, 1);
        new_train_patterns              = [repmat(train_patterns, 1, Nc); coding_matrix(:, target_mat(:)')];

        %Build new test data
        target_mat                      = repmat(1:length(Uc), Ntest, 1);
        new_test_patterns               = [repmat(test_patterns, 1, Nc); coding_matrix(:, target_mat(:)')];

        in_new = D+[1:size(coding_matrix,1)];
       
    otherwise
        error('Unknown method')
end
new_train_targets               = zeros(1, Nc*N);
for i = 1:Nc,
    new_train_targets((i-1)*N+find(temp_train_targets==i))  = 1;
end

if resample
    Nresample   = min(5, Nc-1); 
    use_flag    = zeros(1, Nc*N);
    for i = 1:N,
        in_current                              = i:N:N*Nc;
        in_current                              = in_current([1:temp_train_targets(i)-1, temp_train_targets(i)+1:Nc]);
        in_current                              = in_current(randperm(Nc-1));

        use_flag(i+N*(temp_train_targets(i)-1)) = 1;
        use_flag(in_current(1:Nresample))       = 1;
    end
    in_use_flag         = find(use_flag);

    new_train_patterns  = new_train_patterns(:, in_use_flag);
    new_train_targets   = new_train_targets(:,  in_use_flag);
end

%Normalize the data
m                               = mean(new_train_patterns(in_new, :)')';
s                               = std (new_train_patterns(in_new, :)')';
s(find(s==0))                   = 1;
new_train_patterns(in_new, :)   = (new_train_patterns(in_new, :) - m*ones(1, size(new_train_patterns, 2))) ./ (s * ones(1, size(new_train_patterns, 2)));
new_test_patterns(in_new, :)    = (new_test_patterns(in_new, :)  - m*ones(1, size(new_test_patterns, 2)))  ./ (s * ones(1, size(new_test_patterns, 2)));

%Build classifier
output              = feval(class_alg, new_train_patterns, new_train_targets, new_test_patterns, class_alg_params);
output              = reshape(output, size(test_patterns, 2), Nc)';
[m, I]              = max(output);
test_targets        = Uc(I);

%END

